import axios from 'axios'
import React, { useEffect, useState, useRef } from 'react'

const Security = () => {
    const [people, setPeople] = useState([])
    const searchValue = useRef('');

    useEffect(() => {
        const getPeople = async () => {
            await axios.post('http://localhost:4000/getPeople')
                .then((vis) => setPeople(vis.data))
                .catch((err) => console.log(err))
        }
        getPeople();
    }, [])


    const handleChange = () => {

    }

    return (
        <div className="register">
            <main>
                <h1>Monitoring people Entering the university</h1>
                <section className='section-search'>
                    <div className='form-control'>
                        <form className='search-form'>
                            <label htmlFor='visitor'>Search Visitor by id Or by Name</label>
                            <input type='text' id='visitor' name='vsitor' ref={searchValue} onChange={handleChange} />
                        </form>
                    </div>
                </section>
                <People />
            </main>
        </div>
    )
}

export default Security
